__NUXT_JSONP__("/blogNDI/post24", (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:[{article:{slug:"post24",tema:d,titolo:f,autore:"Gianluigi",parole:g,data:h,tags:d,img:i,toc:[],body:{type:j,children:[{type:a,tag:k,props:{},children:[{type:b,value:"Il colore bianco fantastico della Luna nel cielo buio sembra un aggancio della musica dei rami dell'albero di pesco, mossi dal vento."}]}]},dir:l,path:"\u002FarticlesNDI\u002Fpost24",extension:m,createdAt:e,updatedAt:e},prev:{slug:"post23",tema:d,titolo:f,autore:"Luca",parole:g,data:h,tags:d,img:i,toc:[],body:{type:j,children:[{type:a,tag:k,props:{},children:[{type:b,value:"Cerco un nome che da nero trovi un aggancio per andare dal bianco dei fiori di pesco, fantastico che oscillando al vento fanno musica."}]}]},dir:l,path:"\u002FarticlesNDI\u002Fpost23",extension:m,createdAt:e,updatedAt:e},next:{slug:"post25",tema:d,titolo:f,autore:"Francesco P",parole:g,data:h,tags:d,img:i,toc:[],body:{type:j,children:[{type:a,tag:k,props:{},children:[{type:b,value:"\"Ciao Bianca!\","},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Ciao Bianco!\"."},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"E' fantanstico incontrarsi qui in questo centro commerciale!\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Davvero. Anche tu qui a fare le spese di Natale?\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"No davvero! io sono qui a rimirar lo cielo ...\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Sei il solito idiota ... (fa il verso) bla, bla, il buio della mente ottenebra le genti ...\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Ma che minchia vai dicendo Bianca??? E' il sonno della ragione genera mostri!\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"E te pareva! adesso tira fuori un riferimento alla filosofia euristica con aggancio"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nsincretistico all'astrofisica del nucleo!\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Sai Bianca che stai dicendo cazzate vero?"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nSai che sei ignorante come una bestia?\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n\"Ecco si. Questa e' musica per le mie orecchie. Ora ricordo"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nperche' ti consideravo un coglione! Se pesco tra uno qualsiasi"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\ndegli altri clienti di questo centro commerciale non e' possibile trovarne"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nuno piu' cretino di te! E non sono pochi, i cretini intendo!\""},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nBianco ora ha una faccia un poco offesa nonche' perplessa."},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nE siccome e' anche assai coraggioso decide di sparire,"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\ncome ogni volta, piu' veloce del vento."},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nFinalmente Bianca sorride di nuovo."},{type:a,tag:c,props:{},children:[]},{type:b,value:"\n(sfumando)"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\nForse e' per quella magliettina che ha visto in quel negozio"},{type:a,tag:c,props:{},children:[]},{type:b,value:"\ne che e' in offerta e che le starebbe proprio bene ..."}]}]},dir:l,path:"\u002FarticlesNDI\u002Fpost25",extension:m,createdAt:e,updatedAt:e},show_parole:false}],fetch:{},mutations:void 0}}("element","text","br",null,"2021-04-03T08:03:34.907Z","Cerco un nome","bianco, fantastico, cielo, buio, aggancio, musica, pesco, vento","11 novembre 2020","Uomo-davanti-ad-un-punto-interrogativo.jpg","root","p","\u002FarticlesNDI",".md")));